var axios=require("axios");function getRestaurants(){var o=L.icon({iconUrl:"./img/markers/cutlery.svg",iconSize:[36,36],iconAnchor:[0,0],popupAnchor:[18,-3]});axios.get("https://shitfoodapi.azurewebsites.net/api/getshit?lat=52.9548&lng=-1.1581").then(function(a){for(var t=0;t<a.data.length;t++)L.marker([a.data[t].lat,a.data[t].lng],{icon:o,alt:a.data[t].name,title:a.data[t].name}).addTo(mymap).bindPopup(a.data[t].name+" : Food Hygiene Rating - "+a.data[t].foodHygieneRating);console.log(a.data)}).catch(function(a){console.log(a)}).finally(function(){alert("Enjoy your food")})}